import { IRouteConfig } from '@common/interfaces/route.interface';

export const combineRoutes = (configs: IRouteConfig[]): IRouteConfig => {
    return configs.reduce<IRouteConfig>(
        (acc, it) => {
            return {
                redirects: [...acc.redirects, ...it.redirects],
                routes: [...acc.routes, ...it.routes],
            };
        },
        { redirects: [], routes: [] },
    );
};
